import { apiService } from './apiService';

export const admissionScoreService = {
    getScores(filters) {
        return apiService.get('/admission-scores', filters);
    },

    getMajorScores(majorId, filters) {
        return apiService.get(`/majors/${majorId}/scores`, filters);
    },

    getUniversityScores(universityId, filters) {
        return apiService.get(`/universities/${universityId}/scores`, filters);
    }
};
